import React from "react";
import { Button } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";
function ScoresShow({ MCQs }) {
  const results = useSelector((state) => state.scoresTrack.scores);
  function calculateScores() {
    var scores = 0;
    results.forEach((results, index) => {
      scores += results[index] == MCQs[index].option;
    });
    return scores;
  }

  return <div>{console.log(calculateScores())}</div>;
}

export default ScoresShow;
